import React from 'react'
import styled from 'styled-components'
import { Link } from 'react-router-dom'
import FoodUpload from '../pages/FoodUpload'

 export const Sidebar = styled.div`
    width: 250px;
    position: fixed;
    top: 0;
    left: 0;
    height: 100vh;
    z-index: 999;
    background: #3256D4;
    color: #fff;
    transition: all 0.3s;

`
export const NavLink = styled.h3`
    color: #ffffff;
    
    
`

function AdminPanel() {
    return (
        <Sidebar>
         <Link to="/orders" > <NavLink >ORDERS</NavLink> </Link>
         <Link to="/foods"> <NavLink>FOODS</NavLink> </Link>
         <Link to="/upload" > <FoodUpload /> <NavLink>UPLOAD FOOD </NavLink>  </Link>
        </Sidebar>
    )
}

export default AdminPanel
